import './Estilos/Style.css';
import "./Estilos/estilos2.css"
import Gestion_avances from './pages/Gestion_avances.jsx';
import Gestion_inscripciones from './pages/Gestion_inscripciones.jsx';
import Gestion_usuario from './pages/Gestion_usuario.jsx';
import Gestion_proyectos from './pages/Gestion_proyectos.jsx';
import Editar_perfil from './pages/Editar_perfil.jsx';
import Ingreso from './pages/Ingreso.jsx';
import ListarProyect from './pages/ListarProyect.jsx';
import ListarIns from './pages/ListarIns.jsx';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Auth0Provider } from "@auth0/auth0-react";  //autenticaci贸n de usuario
import { Routes } from 'react-router-dom';


function App() {
  
  return (     
    <Auth0Provider                 //autenticaci贸n de ususario con Auth0
      domain="misiontic-proyecto.us.auth0.com"
      clientId="S4qEAxjMrFTFLOLcUoDUNeci3bLHJWag"
      redirectUri= {window.location.origin}>    

          <Routes>
          
          <Route path="/GestionAvances" element={ <Gestion_avances/> }/>          
          <Route path="/GestionInscripciones" element={ <Gestion_inscripciones/>}/>                     
          <Route path="/GestionUsuario" element ={<Gestion_usuario/>}/>                 
          <Route path="/GestionProyectos" element = {<Gestion_proyectos/> }/>
          
          <Route path="/EditarPerfil" element ={<Editar_perfil/>}/>     
         
          <Route path="/ListarProyect.jsx" element={<ListarProyect/>}/>
          
          <Route path="/ListarIns" element={<ListarIns/>}/>         
            
          <Route path="/ingreso.jsx" element={<Ingreso/>  }>          
        
        </Route> 

        </Routes>     
         
      
    </Auth0Provider>   
    
      
      
     
  );
}
export default App;
